Gary Bronsons A FIRST BOOK OF C + +, Fourth Edition, takes a hands-on, applied approach to the first programming language course for students studying computer science. The book begins with procedural programming in C, and then gradually introduces object-oriented programming features and the C + + language syntax that enables first-time programmers to use them.

Author: Bronson G.J.
Title: A First Book of C + +
Publisher: Cengage Learning
Year: 2011
Format: PDF


